import React from 'react';


import Jumbotron from 'react-bootstrap/Jumbotron'

import './App.css';


class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render(){
    return (
      <Jumbotron>
        <h1>This is text</h1>
      </Jumbotron>
    );
  }
}

export default App;
